scriptlet.script:
try {
	var docs = JSON.parse(document);
	var ss = [];	
	var slist = docs.componentChild;	
	/*for(i = 0; i < slist.length; i++) {
			var tmp = {};
			tmp.name = slist[i].name;
			tmp.id = slist[i].id;
			ss[slist[i].displayName] = tmp;
	}*/
	slist.forEach(function(item) {
		var tmp = {};
		tmp.name = item.name;
		tmp.id = item.id;
		tmp.displayName = item.displayName;
		ss.push(tmp);
	});

	ss.sort(function(a,b) {
		if(a.displayName < b.displayName) {
			return -1;
			}
			else if(a.displayName > b.displayName) {
			return 1;
			}
			else {
			return 0;
			}
	});

	var ssPlain = JSON.stringify(ss);
	scriptletContext.put("S1",ssPlain);
	scriptletResult = ssPlain;
	scriptletResponse = "success";
}
catch(error) {
	scriptletContext.put("FailureMessage",error);
	scriptletResponse = "failure";
}

